import React, { useState } from 'react';
import './login.scss'
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
function Login() {
    const [email,setemail]=useState('');
    const [password,setpassword]=useState('');
    const navigate=useNavigate('');

    function handelsubmit(e){
        e.preventDefault();
        axios.post('http://localhost:3000/api/v1/login',{email,password})
        .then(res=>console.log(res))
        .catch(err=>console.log(err));
    }
  return (
    <div className='login bgimg'>

        <div className="login-box">
            <h2 className='heading'>Login</h2>
            <form onSubmit={handelsubmit}>


                <label htmlFor="email">Email</label>
                <input type="text" className='email' id="email" onChange={(e)=>{setemail(e.target.value)}} />

                <label htmlFor="password">Password</label>
                <input type="password" className='password' id='password' onChange={(e)=>{
                    setpassword(e.target.value)
                }} />


                <input type="submit" className='submit' />
            </form>
            <p>Do not have an account?<Link to="/signup">Sign Up</Link></p>
        </div>
    </div>
  );
}

export default Login;
